import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { UserAuth } from "../context/AuthContext";

const Login = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");
  const navigate = useNavigate();
  const { login } = UserAuth();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    try {
      await login(email, password);
      navigate("/account");
    } catch (e) {
      setError(e.message);
      console.log(e.message);
    }
  };

  return (
    <div className="Empty-space">
      <br />
      <br />
      <br />
      <br />
      <br />
      <div className="max-w-[700px] mx-auto my-16 p-4">
        <div>
          <h1 className="text-2xl font-bold py-2 text-white">Login Now!</h1>
          <p>
            Don't have an account yet?{" "}
            <Link to="/signup" className="underline">
              Sign up!
            </Link>
          </p>
        </div>
        <form onSubmit={handleSubmit}>
          <div className="flex flex-col py-2">
            <label className="py-2 font-medium text-white">
              Email Address:{" "}
            </label>
            <input
              onChange={(e) => setEmail(e.target.value)}
              className="border p-1 mx-3"
              type="email"
            />
          </div>
          <div className="flex flex-col py-2">
            <label className="py-2 font-medium text-white">Password: </label>
            <input
              onChange={(e) => setPassword(e.target.value)}
              className="border p-1 mx-3"
              type="password"
            />
          </div>
          <button className="border-blue-500 bg-blue-600 hover:bg-blue-500 w-full px-3 py-1 my-2 text-black">
            Login
          </button>
        </form>
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />
      </div>
    </div>
  );
};

export default Login;
